import React from "react";

const Navitem = ({ navItem }) => {
  return (
    <>
      {navItem.map((e) => {
        const { id, item } = e;

        return (
          <>
            <a href="#home">{item}</a>
          </>
        );
      })}
    </>
  );
};

export default Navitem;
